    false,nt"url": null,nt"notes": "This report is the result of the Austin
    City Code 6-7u2019s Energy Conservation Audit and Disclosure Ordinance approved
    in November 2008 (amended in April 2011) to improve the energy efficiency of homes
    and buildings that receive electricity from Austin Energy. The ordinance meets one
    of the goals of the Austin Climate Protection Plan, which is to offset 800 megawatts
    of peak energy demand by 2020. This report contains information on commercial facilities
    that have reported the EPAu2019s Energy Star Portfolio Manager benchmarking results
    in 2013 (*) to the City of Austin. For information on ECAD exemptions and other
    requirements, see Austin City Code Chapter 6-7. Note u2013 (*) Data reported by
